import React from 'react'

export default function Pager() {

//Empty array
var numbers=[];

//for Loop
for(var i=1;i<=10;i++)
{
    numbers.push(i);
    //array.push()
}

    return (
        <div>
             {/* Pagination */}
             <nav className="justify-content-center">
                    <ul className="pagination">
                       {
                           numbers.map((res,index)=><li className="page-item" key={index}>
                                                        <a className="page-link" href="#">{res}</a>
                                                     </li>)
                       }
                    </ul>
                </nav>
            {/* Pagination */}
        </div>
    )
}
